script: |
  super -f text -I q506.spq | sort > q506.out

inputs:
  - name: q506.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * + - col2 NOT IN ( col0 + col1 + col0 + + col0 * ( - - col2 ) * 39 );
  - name: tab1

outputs:
  - name: q506.out
    data: |
      51	14	96
      85	5	59
      91	47	68
